use v5.30;
use warnings FATAL => qw(all);
use strict;
use Carp;
use Data::Dump qw(dump);
use Data::Table::Text qw(:all);
use Test::More qw(no_plan);

my $N = 256;                                                                    # Length of each instruction in bits
my $blockSize = 8;                                                              # Number of bits per block
my $nColumns = $N / $blockSize;                                                 # Number of blocks per instruction

my @instructionsInHex =                                                         # Instructions in hex
  map {my $a = $_; $a =~ s/\A.*?h//; $a =~ s/;.*\Z//; $a} split /\n/, &data;

my @instructionsAsBits;                                                         # Bit representation of each instruction
for my $l(@instructionsInHex)                                                   # Convert each instruction from hex to bits
 {my $X = "0123456789abcdef";                                                   # Hex digits
  push @instructionsAsBits,
    join '', map {sprintf "%04b", index($X, $_)} split //, $l;
 }

my %variants;                                                                   # Variants in each column
for my $n(1..$nColumns)                                                         # Blocks
 {for my $instruction(@instructionsAsBits)                                      # Each instruction
   {$variants{$n}{substr($instruction, $blockSize*($n-1), $blockSize)}++;       # Bits from instruction
   }
 }

if (0)                                                                          # Find best block size to reduce the number of bits needed to store instructions
 {my $bits = 0;                                                                 # Number of columns with variance
  for my $n(sort {$a <=> $b} keys %variants)                                    # Each variant
   {my $n = keys $variants{$n}->%*;                                             # Number of variants in block
    $bits += 1 if $n == 2;                                                      # Number of bits need to code the variants
    $bits += 2 if $n == 3 || $n == 4;
    $bits += 3 if $n == 5 || $n == 6 || $n == 7 || $n == 8;
#   $bits += 4 if $n == 9 || $n ==10 || $n ==11 || $n ==12 || $n ==13 || $n ==14 || $n ==15 || $n ==16;
    $bits += $blockSize if $n > 8;
   }
  say STDERR "Bits: $bits";
 }

my %variantIndex;                                                               # Bit variants to index. All zeroes
my %variantBits;                                                                # Index to bit variant
for my $n(1..$nColumns)                                                         # Blocks
 {my $i = 0;
  my @v = sort keys $variants{$n}->%*;                                          # Variants in binary
  if (@v > 1 && @v <= 8)                                                        # Encode when we have just a few variants
   {for my $v(@v)                                                               # Map variants to indexes
     {$variantBits {$n}{$i} = $v;
      $variantIndex{$n}{$v} = $i++;
     }
   }
  elsif (@v == 1 and $v[0] !~ m(\A0+\Z))                                        # Detect static variant that is not zero
   {say STDERR "Static variant at column $n: $v[0]";
   }
 }

my sub instructionColumn($$)                                                    # Name of a look up table
 {my ($col, $index) = @_;                                                       # Parameters
  sprintf "inCol%02d[$index]", $col;
 }

my sub log2($)                                                                  # Name of a look up table
 {my ($n) = @_;                                                                 # Parameters
  return 0 if $n <= 1;
  return 1 if $n <= 2;
  return 2 if $n <= 4;
  return 3 if $n <= 8;
  undef
 }

my @text;                                                                       # Write look up tables as code
push @text, "// Look up tables for instruction components";
for my $n(1..$nColumns)                                                         # Blocks
 {if (my $lut = $variantIndex{$n})                                              # Look up table required
   {my $c = scalar keys %$lut;
    push @text, join ' ', "reg[$blockSize-1:0]", instructionColumn($n, $c).";";
    for my $v(sort {$a <=> $b} keys %$lut)                                      # Map variants to indexes
     {push @text, join ' ', instructionColumn($n, $$lut{$v}), "=", "'b$v;";
     }
   }
 }
#say STDERR "AAAA", dump(\%variants); say STDERR "AAAA", dump(\%variantIndex); exit;

my @compressed;                                                                 # Compressed instructions
push @text, "// Compressed instructions";
for my $i(keys @instructionsAsBits)                                             # Represent each instruction
 {my @b;
  for my $n(1..$nColumns)                                                       # Blocks in instruction
   {my $bits = substr($instructionsAsBits[$i], $blockSize*($n-1), $blockSize);  # Bits of instruction
    my $w    = log2 keys $variants{$n}->%*;                                     # Block width
    if ($w)
     {my $luti = $variantIndex{$n}{$bits};                                      # Write index into a look up table
      push @b, sprintf "%0${w}b", $luti;
     }
    elsif (defined($w) and $w == 0) {}                                          # Zero bits
    else                                                                        # Bits as they are without look up
     {push @b, $bits;
     }
   }
  my $c = join '', @b;                                                          # Bits for instruction
  push @compressed, $c;                                                         # Compressed instruction
  push @text, "code[$i] = 'b$c;";                                               # Assemble compressed instruction from blocks
 }

if (1)                                                                          # Decode instruction
 {my @i;
  my $p = 0;
  push @text, "// Decompress instructions";
  for my $n(1..$nColumns)                                                       # Blocks in instruction
   {my $w = log2 keys $variants{$n}->%*;
    if ($w)                                                                     # Decode from a look up table
     {my $q = $p + $w - 1;
      push @i, instructionColumn($n, "instruction[$q:$p]");
      $p += $w;
      next;
     }
    if (defined($w) and $w == 0)
     {push @i, join '', "'b", "0" x $blockSize;
      next;
     }                                                                          # Zero bits
    my $q = $p + $blockSize - 1;
    push @i, "instruction[$q:$p]";
    $p += $blockSize;
   }
  push @text, join " ", '{', join(", ", @i), '}';                               # Decompressed instruction
 }

if (1)                                                                          # Check instructions decode correctly
 {for my $i(keys @compressed)                                                   # Each compressed instruction
   {my @i;
    my $p = 0;
    for my $n(1..$nColumns)                                                     # Blocks in instruction
     {my $w = log2 keys $variants{$n}->%*;
      if ($w)                                                                   # Decode from a look up table
       {my $c = $compressed[$i];
        my $b = substr($c, $p, $w);
        my $x = oct "0b$b";                                                     # Convert binary string
        my $l = $variantBits{$n}{$x};                                           # Look up correspondinbg bits
        push @i, $l;
        $p += $w;
        next;
       }
      if (defined($w) and $w == 0)
       {push @i, "0" x $blockSize;
        next;
       }
      my $q = $p + $blockSize - 1;
      push @i, substr($compressed[$i], $p, $blockSize);
      $p += $blockSize;
     }
    my $got = join '', @i;
    my $exp = $instructionsAsBits[$i];
    is_deeply $got, $exp;
   }
 }

say join "\n", @text;
done_testing;

